public void interrupt() {
    Iterator<Object> it = Flowable.never().blockingNext().iterator();

    try {
        Thread.currentThread().interrupt();
        it.next();
    } catch (RuntimeException ex) {
        assertTrue(ex.toString(), ex.getCause() instanceof InterruptedException);
    }
}

